				<Placemark id="khPlacemark43427">
					<name>Calaveras Fault</name>
					<Snippet maxLines="0" id="khSnippet43625"></Snippet>
					<description><![CDATA[<p>Like the San Andreas, the Calaveras fault is a strike-slip fault with right-lateral movement. The Calaveras branches off from the San Andreas just to the south of the city of Hollister. The fault is slipping continually causing curbsides and roads to be warped, as it can be observed in Hollister, but it is also saving part of its movement for a sudden slip that could cause an earthquake, particularly the northern segment in the San Ramon Valley.</br>
For more information: <a href="http://quake.wr.usgs.gov/prepare/ncep/calaveras.html">Calaveras Fault</a>
</p>]]></description>
