				<Placemark id="khPlacemark43586">
					<name>Mt. Diablo Fault</name>
					<Snippet maxLines="0" id="khSnippet43625"></Snippet>
					<description><![CDATA[<p>Unlike the other faults within the Bay Area, the Mt. Diablo fault does not break the Earth's surface.  Rather it is a blind thrust-fault, where the rocks to the southwest are forced over the rocks to the northeast of the fault line. The fault acts essentially as a ramp, and movement upward along the fault is expressed at the surface as folding rather than fault rupture.</br>
For more information: <a href = "http://www.mdia.org/geology%20guide.htm">Mt. Diablo Fault</a>
</p>]]></description>
