				<Placemark id="khPlacemark43543">
					<name>Hayward Fault</name>
					<Snippet maxLines="0" id="khSnippet43894"></Snippet>
					<description><![CDATA[<p>The Hayward fault is a major branch of the San Andreas fault system.  Like the San Andreas, it is a right-lateral strike-slip fault. The Hayward fault is considered the most hazardous in the Bay Area, because it bisects the densely populated East Bay.  The most recent large earthquake (magnitude approx. 7) occurred on the Hayward fault in 1868.</br>
For more information: <a href="http://quake.wr.usgs.gov/research/geology/hf_map/index.html">Hayward Fault</a> </p>]]></description>
