				<Placemark id="khPlacemark43624">
					<name>Rodgers Creek Fault</name>
					<Snippet maxLines="0" id="khSnippet43625"></Snippet>
					<description><![CDATA[<p>The northern continuation of the Hayward fault, the Rodgers Creek fault extends from San Pablo Bay through Santa Rosa.  Like the Hayward fault, the Rodgers Creek is one of the most active in the Bay Area, with the highest probability of rupture in the next 30 years.</br>
