				<Placemark id="khPlacemark43700">
					<name>San Andreas Fault</name>
					<Snippet maxLines="0" id="khSnippet43701"></Snippet>
					<description><![CDATA[<p>The San Andreas, a right-lateral strike-slip fault, is the main fault of the California coastal region and marks a transform boundary between the Pacific Plate and the North American Plate. It consists of a complex zone of crushed and broken rock from a few hundred feet to a mile wide that spans a length of roughly 800 miles (1287 km) along California and reaches a depth of at least 10 miles.  When viewed from the ground the features that characterize it can be subtle.  When viewed fom the air however, the linear arrangement of lakes, bays, and valleys along it is striking.  The entire length of the northern San Andreas fault, about 296 miles, moved in 1906.</br>
For more information: <a href="http://pubs.usgs.gov/gip/earthq3/" >San Andreas Fault</a></p>]]></description>
