				<Placemark id="khPlacemark43793">
					<name>San Gregorio Fault</name>
					<Snippet maxLines="0" id="khSnippet12606"></Snippet>
					<description><![CDATA[<p>The San Gregorio fault, is the westernmost of the major earthquake sources in the Bay Area. Information for this fault has been elusive because much of it lies offshore or is deeply buried by modern valley fill but trenching studies show that large earthquakes (magnitude 7+) have occurred on the northern part of the fault during the past 600-1400 years.</br>
For more information: <a href="http://quake.wr.usgs.gov/prepare/ncep/andreas.html">San Gregorio Fault</a> </p>]]></description>
