	<Folder>
		<name>Damage from Shaking</name>
		<Placemark>
			<name>48th and Lawton</name>
			<Snippet maxLines="0"></Snippet>
			<description><![CDATA[<table border="5" bgcolor="#f5f5dc" cellspacing="5" cellpadding="10">
<tr border="0">
<td border="0">
<img src="https://earthquake.usgs.gov/earthquakes/events/1906calif/virtualtour/kml/images/SF_48_Lawton.jpg" width="600" height="326">
<p>"Forty-eighth Avenue, between K and N Streets, is a district underlain by deep sand where extensive grading operations were undoubtly necessary to convert an area of sand-dunes into streets and building lots. Here small, substantial frame dwellings were shifted bodily from 1 to 2 feet out of position, and the streets were slightly dislocated. Telegraph poles were thrown down or caused to lean over so much that only the tension of the wires kept them from falling completely, and lamp posts were overthrown." From Lawson, 1908.  The epicenter was just two miles west of this site.
</p>
</td>
</tr>
</table>
<a href="http://bancroft.berkeley.edu/collections/earthquakeandfire/index2.html">Courtesy of The Bancroft Library</a><br>University of California, Berkeley<br>BANC PIC 1957.007 Ser. 1 :082]]></description>
