		<Placemark>
			<name>Agnew&apos;s Asylum</name>
			<Snippet maxLines="0"></Snippet>
			<description><![CDATA[<table border="5" bgcolor="#f5f5dc" cellspacing="5" cellpadding="10">
<tr border="0">
<td border="0">
<img src="https://earthquake.usgs.gov/earthquakes/events/1906calif/virtualtour/kml/images/agnew_asylum.jpg" width="600" height="379">
<p>Damage to Agnew&apos;s Asylum.  Most loss of life from the earthquake in the South Bay occurred here: 101 mentally ill inmates and 11 doctors and staff members were killed by falling bricks. Days after the earthquake, inspectors believed that poor lime mortar between the bricks was the main contributor to structural failure. Did contractors cut costs and build unsound buildings at public expense? We&apos;ll never really know. All of these tall brick buildings were razed and replaced. This location is now the main campus of Sun Microsystems.</p>
</td>
</tr>
</table>
<a href="http://bancroft.berkeley.edu/collections/earthquakeandfire/index2.html">Courtesy of The Bancroft Library</a><br>University of California, Berkeley<br>FN-32870
<br>Property of <a href="http://www.californiahistoricalsociety.org">The California Historical Society</a>]]></description>
