<p>Phelan Building in San Jose.  James Phelan was a wealthy capitalist with investments in both San Francisco and San Jose. The Phelan building typifies the soft-story, corner, brick construction that wasn&apos;t strong enough to withstand horizontal shaking from the earthquake. One person was killed in the collapse: a dentist named Dr. DeCrow.</p>
