			<description><![CDATA[<table border="5" bgcolor="#f5f5dc" cellspacing="5" cellpadding="10">
<tr border="0">
<td border="0">
<img src="https://earthquake.usgs.gov/earthquakes/events/1906calif/virtualtour/kml/images/PtPinosLighthouse.jpg" width="600" height="232">
<p>Photograph on left from a snapshot in a family vacation album shows workmen standing on scaffolding at the Point Pinos Lighthouse (in Monterey County) during reconstruction work on the beacon tower. Before the earthquake, this part of the building was brick, but was replaced with reinforced concrete. The Lighthouse had a temporary light until August 18, when the third-order Fresnel lens that had been sent to France for repairs was reinstalled and lit. During the interim, Lighthouse keeper Emily Fish noted 11 aftershocks in the official log book.  Photograph on right shows the lighthouse today.</p>
