			<description><![CDATA[<table border="5" bgcolor="#f5f5dc" cellspacing="5" cellpadding="10">
<tr border="0">
<td border="0">
<img src="https://earthquake.usgs.gov/earthquakes/events/1906calif/virtualtour/kml/images/PtReyes_train.jpg" width="600" height="402">
<p>"At Point Reyes Station at the head of Tomales bay the 5:15 train for San Francisco was just ready. The conductor had just swung himself on when the train gave a great lurch to the east, followed by another to the west, which threw the whole train on its side. The astonished conductor dropped off as it went over, and at sight of the falling chimneys and breaking windows of the station, he understood that it was the Temblor. The fireman turned to jump from the engine to the west when the return shock came. He then leaped to the east and borrowing a kodak he took the picture of the train here presented." (From "The 1906 California Earthquake", David Starr Jordan, Editor, 1907, A.M. Robertson, San Francisco.)</p>
</td>
</tr>
</table>
<a href="http://libraryphoto.cr.usgs.gov/htmllib/earth1.htm">Courtesy of the U.S. Geological Survey.</a>]]></description>
