			<description><![CDATA[<table border="5" bgcolor="#f5f5dc" cellspacing="5" cellpadding="10">
<tr border="0">
<td border="0">
<img src="https://earthquake.usgs.gov/earthquakes/events/1906calif/virtualtour/kml/images/PostOffice.jpg" width="600" height="484">
<p>This building didn&apos;t really tilt as it appears in the photograph. It lost the top two stories of its tower, which came crashing down on the roof. The rest of the steel-reinforced stone building survived and today houses the San Jose Museum of Art. The City of San Jose is considering restoring the tower to its original six-story height.</p>
</td>
</tr>
</table>
