			<description><![CDATA[<table border="5" bgcolor="#f5f5dc" cellspacing="5" cellpadding="10">
<tr border="0">
<td border="0">
<img src="https://earthquake.usgs.gov/earthquakes/events/1906calif/virtualtour/kml/images/StaRosa_street_scene.jpg" width="600" height="386">
<p>"The shock of April 18 and the ensuing fire caused a loss of life of 61 identified dead, with at least a dozen "missing", and practically destroyed the business portion of Santa Rosa. The equivalent of some 7 to 8 blocks was destroyed by the earthquake, and from 4 to 5 blocks by the fire." (Excerpt from Lawson, 1908). Exact location of photograph unknown.</p>
