		<Placemark>
			<name>Santa Rosa home</name>
			<Snippet maxLines="0"></Snippet>
			<description><![CDATA[<table border="5" bgcolor="#f5f5dc" cellspacing="5" cellpadding="10">
<tr border="0">
<td border="0">
<img src="https://earthquake.usgs.gov/earthquakes/events/1906calif/virtualtour/kml/images/StaRosa_house2.jpg" width="600" height="320">
<p>Wood-frame house "thrown" from its foundation in Santa Rosa.  Many one and two-story houses were built with "cripple walls," that is, 3-5&apos; walls between the foundation and the first floor.  If the house was shaken strongly, the unbraced cripple walls failed and the first floor fell to the ground, or was displaced or thrown from the foundation.</p>
</td>
</tr>
</table>
<a href="http://libraryphoto.cr.usgs.gov/htmllib/earth1.htm">Courtesy of the U.S. Geological Survey.</a>]]></description>
