			<name>S. F. City Hall</name>
			<Snippet maxLines="0"></Snippet>
			<description><![CDATA[<table border="5" bgcolor="#f5f5dc" cellspacing="5" cellpadding="10">
<tr border="0">
<td border="0">
<img src="https://earthquake.usgs.gov/earthquakes/events/1906calif/virtualtour/kml/images/SF_CityHall.jpg" width="600" height="398">
<p>San Francisco City Hall before (left) and after (right) the earthquake.  The ruin of this \$6 million building came to symbolize the corruptness of the city government before the earthquake.  Recent engineering analyses have demonstrated that the damage was caused by a weakness in the design of the building, however.  The "drum" beneath the dome was not laterally braced, and it shed its heavy stone facade. It was the fall of this facade that wrecked the building.</p>
</td>
</tr>
</table>
<a href="http://bancroft.berkeley.edu/collections/earthquakeandfire/index2.html">Courtesy of The Bancroft Library</a><br>University of California, Berkeley<br>Left photograph: BANC PIC 1905.06545:09--PIC<br>Right photograph: FN-34579
<br>Property of <a href="http://www.californiahistoricalsociety.org">The California Historical Society</a>]]></description>
